import React, { useRef } from "react";
import "./placement.css";
import { FaArrowLeft, FaArrowRight } from "react-icons/fa";

const Placement = () => {
  const studentScrollRef = useRef(null);

  const students = [
    {
      name: "Pooja Powar",
      program: "B.Sc. Computer Science",
      year: "2023",
      company: "TCS",
      photo: "https://via.placeholder.com/120x120.png?text=Pooja",
      bg: "linear-gradient(135deg, #0a2141 0%, #c8b37e 100%)",
    },
    {
      name: "Ravi Kumar",
      program: "MBA Finance",
      year: "2022",
      company: "Infosys",
      photo: "https://via.placeholder.com/120x120.png?text=Ravi",
      bg: "linear-gradient(135deg, #1f2937 0%, #c8b37e 100%)",
    },
    {
      name: "Sneha Patel",
      program: "B.Tech IT",
      year: "2024",
      company: "Wipro",
      photo: "https://via.placeholder.com/120x120.png?text=Sneha",
      bg: "linear-gradient(135deg, #0a2141 0%, #bca25f 100%)",
    },
  ];

  const companies = [
    { name: "TCS", logo: "https://via.placeholder.com/100x50?text=TCS" },
    { name: "Infosys", logo: "https://via.placeholder.com/100x50?text=Infosys" },
    { name: "Wipro", logo: "https://via.placeholder.com/100x50?text=Wipro" },
    { name: "Accenture", logo: "https://via.placeholder.com/100x50?text=Accenture" },
    { name: "Cognizant", logo: "https://via.placeholder.com/100x50?text=Cognizant" },
  ];

  const scroll = (direction) => {
    const { current } = studentScrollRef;
    direction === "left"
      ? (current.scrollLeft -= 300)
      : (current.scrollLeft += 300);
  };

  return (
    <div className="placement-section">
      {/* SECTION 1: STUDENT PLACEMENTS */}
      <div className="placement-header">
        <h2 className="placement-title">Our Proud Achievers</h2>
        <p className="placement-subtitle">
          Meet the students who made us proud with their outstanding placements.
        </p>
      </div>

      <div className="placement-carousel-container">
        <button className="arrow-btn left" onClick={() => scroll("left")}>
          <FaArrowLeft />
        </button>

        <div className="placement-carousel" ref={studentScrollRef}>
          {students.map((student, index) => (
            <div
              className="placement-card"
              key={index}
              style={{ background: student.bg }}
            >
              <div className="placement-photo">
                <img src={student.photo} alt={student.name} />
              </div>
              <div className="placement-info">
                <h3>{student.name}</h3>
                <p>{student.program}</p>
                <p>Passout Year: {student.year}</p>
                <p>Placed at: <strong>{student.company}</strong></p>
              </div>
            </div>
          ))}
        </div>

        <button className="arrow-btn right" onClick={() => scroll("right")}>
          <FaArrowRight />
        </button>
      </div>

      {/* SECTION 2: COMPANY LOGOS */}
      <div className="company-section">
        <h2 className="placement-title">Top Recruiters</h2>
        <p className="placement-subtitle">
          Our students have been placed in leading companies.
        </p>

        <div className="company-marquee">
          <div className="company-track">
            {companies.concat(companies).map((company, i) => (
              <div className="company-logo" key={i}>
                <img src={company.logo} alt={company.name} />
                <p>{company.name}</p>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Placement;
